import React from 'react';
import { connect } from "react-redux";


function List(props) {
    return (
        <ul>
            {
                props.todos.map((todo , index) =>(
                    <li key = "index">{todo.message}</li>
           ))
            }
        </ul>
    )
}
const mapStateToProps = (state) => {
    return {
        todos: state.todos.data,
    }
}

export default List;
